import React from 'react'
import './input.css'


const Input = ({searchfield, searchChange}) => {
    return (
        <div className="">
            <input 
                className=""
                type="search" 
                placeholder="search..."
                onChange={searchChange}
            />
        </div>
    );
}

export default Input;
